script: |
  super -f text -I q5560.spq | sort > q5560.out

inputs:
  - name: q5560.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE + col1 + - - 26 NOT BETWEEN + col2 AND - col1 * col0 + - - ( - 71 ) * + col1;
  - name: tab1

outputs:
  - name: q5560.out
    data: |
      51	14	96
      85	5	59
      91	47	68
